  const [trees, setTrees] = useState([])


  useEffect(() => {
    getTheTrees();
  },[])

  const getTheTrees = () => {
    axios.get("https://data.calgary.ca/resource/tfs4-3wwa.json")
    .then((response) => {
      const allTrees = response.data;
